DROP TABLE IF EXISTS abcd_rate
CREATE TABLE `abcd_rate` (  `id` int(11) NOT NULL AUTO_INCREMENT,  `o_typename` varchar(20) NOT NULL COMMENT '类型名',  `ab_rate` float NOT NULL DEFAULT '0' COMMENT 'A与B盘差值',  `ac_rate` float NOT NULL DEFAULT '0' COMMENT 'A与C盘差值',  `ad_rate` float NOT NULL DEFAULT '0' COMMENT 'A与D盘差值',  `o_ids` varchar(30) DEFAULT '0' COMMENT '关联的赔率设置分类id',  `ao` int(2) NOT NULL DEFAULT '0' COMMENT '排序',  PRIMARY KEY (`id`),  KEY `o_typename` (`o_typename`)) ENGINE=MyISAM DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='ABCD盘率差表'
DROP TABLE IF EXISTS accountopen
CREATE TABLE `accountopen` (  `id` int(11) NOT NULL AUTO_INCREMENT,  `user_id` int(11) NOT NULL COMMENT '用户id',  `plate_num` varchar(10) NOT NULL COMMENT '格式“年+期数”，如：2012106',  `time` int(11) NOT NULL COMMENT '下注时间',  `o_type1` varchar(10) DEFAULT NULL COMMENT '选择下注的类型1（如特码，正码）',  `o_type2` varchar(10) DEFAULT NULL COMMENT '选择下注的类型2 （如特码A，特码B）',  `o_type3` varchar(255) DEFAULT NULL COMMENT '要下注金额的类型3（号码，双面，波色，生肖等...）',  `orders_y` float NOT NULL DEFAULT '0' COMMENT '下注金额',  `orders_p` float NOT NULL DEFAULT '0' COMMENT '下注时的赔率值',  `orders_p_2` varchar(30) DEFAULT NULL COMMENT '下载时分公司和公司的赔率',  `is_maxorders_p` int(2) NOT NULL DEFAULT '0' COMMENT '中奖是否为大赔率，只有二中特，三中二有',  `abcd_h` varchar(10) NOT NULL DEFAULT 'A' COMMENT '下注对应的会员盘（分A,B,C,D盘）',  `h_tui` float NOT NULL DEFAULT '0' COMMENT '会员退水值',  `d_tui` float NOT NULL DEFAULT '0' COMMENT '代理退水值',  `zd_tui` float NOT NULL DEFAULT '0' COMMENT '总代理退水值',  `gd_tui` float NOT NULL DEFAULT '0' COMMENT '股东退水值',  `f_tui` float NOT NULL DEFAULT '0' COMMENT '分公司退水值',  `g_tui` float NOT NULL DEFAULT '0' COMMENT '分公司退水值',  `d_z` float NOT NULL DEFAULT '0' COMMENT '代理占成值',  `zd_z` float NOT NULL DEFAULT '0' COMMENT '总代理占成值',  `gd_z` float NOT NULL DEFAULT '0' COMMENT '股东占成值',  `f_z` float NOT NULL DEFAULT '0' COMMENT '分公司占成值',  `g_z` float NOT NULL DEFAULT '0' COMMENT '公司占成值',  `topd_id` int(11) NOT NULL DEFAULT '0' COMMENT '上级代理id',  `topzd_id` int(11) NOT NULL DEFAULT '0' COMMENT '上级总代理id',  `topgd_id` int(11) NOT NULL DEFAULT '0' COMMENT '上级股东id',  `topf_id` int(11) NOT NULL DEFAULT '0' COMMENT '上级分公司id',  `keying_y` float NOT NULL DEFAULT '0' COMMENT '可赢金额（下注金额*赔率-下注金额+该注退水金额）',  `shuying_y` float NOT NULL DEFAULT '0' COMMENT '输赢金额（中奖金额-下注金额，输赢金额不是最终的金额，输赢金额+退水金额才是最终金额，中奖金额为下注金额*下注类型的赔率）',  `tuishui_y` float NOT NULL DEFAULT '0' COMMENT '该注单退水金额（下注类型金额*下注类型的退水率--------退水也叫佣金）',  `is_win` int(2) NOT NULL DEFAULT '0' COMMENT '是否中奖,0为不中奖，1为中奖',  `fly_user` int(2) NOT NULL DEFAULT '0' COMMENT '下级走飞归属（分0“全归公司”，1“全归分公司”和2“按各级成数分配”）',  `fly_user_id` varchar(100) NOT NULL DEFAULT ',1,' COMMENT '该走飞单归属id',  `is_fly` int(2) NOT NULL DEFAULT '0' COMMENT '是否走飞单，0为否，1为是',  `is_zhishu` int(2) DEFAULT '0' COMMENT '是否直属会员单,0为否，1为是',  `history_is_account` int(2) NOT NULL DEFAULT '0' COMMENT '是否结算0未结算，1已结算',  PRIMARY KEY (`id`),  KEY `plate_num` (`plate_num`)) ENGINE=MyISAM AUTO_INCREMENT=264 DEFAULT CHARSET=utf8 COMMENT='下注表'
DROP TABLE IF EXISTS admin_users_action
CREATE TABLE `admin_users_action` (  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '日志id',  `uid` int(11) NOT NULL COMMENT '操作用户(用户id及用户名)',  `datetime` int(20) NOT NULL COMMENT '操作时间',  `title` varchar(255) NOT NULL COMMENT '操作页面（标题）',  `phases` varchar(50) NOT NULL COMMENT '当前六合彩期数',  `ip` varchar(50) NOT NULL COMMENT 'ip地址',  `location` varchar(100) NOT NULL COMMENT '位置',  `mark` smallint(2) NOT NULL,  PRIMARY KEY (`id`),  KEY `uid` (`uid`)) ENGINE=MyISAM AUTO_INCREMENT=17611 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='操作日志记录表'
DROP TABLE IF EXISTS animal
CREATE TABLE `animal` (  `id` int(5) NOT NULL AUTO_INCREMENT,  `set_id` int(3) NOT NULL COMMENT '系统设置表对应的set_animal',  `num` int(3) NOT NULL COMMENT '号码',  `animal` varchar(4) NOT NULL COMMENT '生肖名',  `color` varchar(4) NOT NULL COMMENT 'r红色，g绿色，b蓝色',  PRIMARY KEY (`id`),  KEY `set_id` (`set_id`)) ENGINE=MyISAM DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='生肖表'
DROP TABLE IF EXISTS animal_set
CREATE TABLE `animal_set` (  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT 'id',  `set_animal` int(3) NOT NULL COMMENT 'animal编号,1-12，鼠,牛,虎,兔,龙,蛇,马,羊,猴,鸡,狗,猪',  `set_tieme` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '设置时间',  `w_name` varchar(50) DEFAULT NULL COMMENT '网站名称',  `w_dress` varchar(50) DEFAULT NULL COMMENT '网站地址',  `w_new` varchar(255) DEFAULT NULL COMMENT '网站公告',  `w_is_lock` int(2) NOT NULL DEFAULT '0' COMMENT '0正常，1维护开启中',  `w_yanzheng1` varchar(10) DEFAULT NULL COMMENT '管理员验证码',  `w_yanzheng2345` varchar(10) DEFAULT NULL COMMENT '代理验证码',  `w_yanzheng6` varchar(10) DEFAULT NULL COMMENT '会员验证码',  `w_close_type` varchar(100) DEFAULT NULL COMMENT '关闭项目',  `w_is_creditline` int(2) NOT NULL DEFAULT '0' COMMENT '0不自动还原信用额度，1自动还原信用额度',  `w_user_total2` int(10) NOT NULL DEFAULT '0' COMMENT '分公司可开会员个数',  `w_user_total3` int(10) NOT NULL DEFAULT '0' COMMENT '股东可开会员个数',  `w_user_total4` int(10) NOT NULL DEFAULT '0' COMMENT '总代理可开会员个数',  `w_user_total5` int(10) NOT NULL DEFAULT '0' COMMENT '代理可开会员个数',  PRIMARY KEY (`id`),  UNIQUE KEY `set_animal` (`set_animal`)) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='系统设置表'
DROP TABLE IF EXISTS autorain_set
CREATE TABLE `autorain_set` (  `o_typename` varchar(20) NOT NULL COMMENT '降水类型名（特码，正特，正码，两面，波色，特肖，一肖，二肖，三肖，四肖，五肖，六肖，半波，尾数）',  `autodesc_limit` float NOT NULL DEFAULT '0' COMMENT '自动降限额',  `desc_odds` float NOT NULL DEFAULT '0' COMMENT '下降赔率',  `lowest_odds` float NOT NULL DEFAULT '1' COMMENT '最低赔率',  `amode` int(2) NOT NULL DEFAULT '0' COMMENT '选择类型（0为按总额自动降，1为按占成自动降）',  `is_use` int(2) NOT NULL DEFAULT '1' COMMENT '是否启用（0为关闭，1为开启）',  `o_ids` varchar(255) DEFAULT '0' COMMENT '关联的下注分类id',  `auto_time` int(3) NOT NULL DEFAULT '1' COMMENT '下降时间',  `view_order` int(3) NOT NULL DEFAULT '0' COMMENT '排序',  PRIMARY KEY (`o_typename`),  KEY `view_order` (`view_order`) USING BTREE,  KEY `o_typename` (`o_typename`)) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='自动降水表'
DROP TABLE IF EXISTS back_set
CREATE TABLE `back_set` (  `user_id` int(10) NOT NULL COMMENT '用户id',  `set_name` varchar(30) NOT NULL COMMENT '交易类型',  `percent_a` float NOT NULL DEFAULT '2.5' COMMENT 'A盘退水占成百分率',  `percent_b` float NOT NULL DEFAULT '2.5' COMMENT 'B盘退水占成百分率',  `percent_c` float NOT NULL DEFAULT '2.5' COMMENT 'C盘退水占成百分率',  `percent_d` float NOT NULL DEFAULT '2.5' COMMENT 'D盘退水占成百分率',  `bottom_limit` int(10) NOT NULL DEFAULT '10' COMMENT '最低限额',  `top_limit` int(10) NOT NULL DEFAULT '500000' COMMENT '最高限额',  `odd_limit` int(10) NOT NULL DEFAULT '5000000' COMMENT '单码限额',  `view_order` int(3) NOT NULL DEFAULT '0' COMMENT '排序',  PRIMARY KEY (`user_id`,`set_name`),  KEY `view_order` (`view_order`) USING BTREE,  KEY `user_id` (`user_id`),  KEY `set_name` (`set_name`)) ENGINE=MyISAM DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='退水设置表'
DROP TABLE IF EXISTS backorder_set
CREATE TABLE `backorder_set` (  `user_id` int(11) NOT NULL COMMENT '设置补货的用户id，0为默认',  `o_typename` varchar(20) NOT NULL COMMENT '补货类型名（特码A，正一特A等等）',  `amode` int(2) NOT NULL DEFAULT '0' COMMENT '选择计算方式（0为下注额----暂时只有这个类型）',  `control_limit` float NOT NULL DEFAULT '0' COMMENT '控制额度（默认0）',  `lowest_limit` float NOT NULL DEFAULT '0' COMMENT '最低可调额度（默认0）',  `begin_limit` float NOT NULL DEFAULT '1' COMMENT '起补额度（默认1）',  `is_use` int(2) NOT NULL DEFAULT '0' COMMENT '是否启用（0为关闭，1为开启）',  `o_ids` varchar(255) NOT NULL DEFAULT '0' COMMENT '关联的下注分类id',  `view_order` int(3) NOT NULL DEFAULT '0' COMMENT '排序',  PRIMARY KEY (`user_id`,`o_typename`),  KEY `view_order` (`view_order`) USING BTREE,  KEY `user_id` (`user_id`),  KEY `o_typename` (`o_typename`)) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='自动补货设定表'
DROP TABLE IF EXISTS caijikaijiang
CREATE TABLE `caijikaijiang` (  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT 'id',  `num_a` varchar(2) NOT NULL DEFAULT '0' COMMENT '开奖号码1',  `num_b` varchar(2) NOT NULL DEFAULT '0' COMMENT '开奖号码2',  `num_c` varchar(2) NOT NULL DEFAULT '0' COMMENT '开奖号码3',  `num_d` varchar(2) NOT NULL DEFAULT '0' COMMENT '开奖号码4',  `num_e` varchar(2) NOT NULL DEFAULT '0' COMMENT '开奖号码5',  `num_f` varchar(2) NOT NULL DEFAULT '0' COMMENT '开奖号码6',  `num_g` varchar(2) NOT NULL DEFAULT '0' COMMENT '开奖号码7',  `plate_num` varchar(10) NOT NULL COMMENT '格式“年+期数”，如：2012106',  PRIMARY KEY (`id`),  UNIQUE KEY `plate_num` (`plate_num`)) ENGINE=MyISAM AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='采集开奖表'
DROP TABLE IF EXISTS cut_code
CREATE TABLE `cut_code` (  `cut_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',  `number` varchar(10) NOT NULL COMMENT '号码',  `money` int(11) NOT NULL COMMENT '金额',  `type_id` int(11) NOT NULL COMMENT '赔率分类id',  `cut_type` varchar(255) NOT NULL COMMENT '切割码类型（百分比，爆码，自定义）',  `cut_num` int(11) NOT NULL DEFAULT '1' COMMENT '割码次数',  PRIMARY KEY (`cut_id`)) ENGINE=MyISAM AUTO_INCREMENT=488 DEFAULT CHARSET=utf8 COMMENT='切割码'
DROP TABLE IF EXISTS cut_off
CREATE TABLE `cut_off` (  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',  `typename` varchar(255) NOT NULL COMMENT '下注类型',  `type` varchar(255) NOT NULL COMMENT '禁止类型top_头，foot_尾',  `num` text NOT NULL COMMENT '禁止码',  `off_p` int(11) NOT NULL DEFAULT '0' COMMENT '限制组数',  PRIMARY KEY (`id`)) ENGINE=MyISAM AUTO_INCREMENT=28 DEFAULT CHARSET=utf8 COMMENT='禁止割码表'
DROP TABLE IF EXISTS fixed_type
CREATE TABLE `fixed_type` (  `f_id` int(11) NOT NULL AUTO_INCREMENT,  `f_typename` varchar(10) NOT NULL COMMENT '下注类型名',  `f_content` varchar(255) NOT NULL COMMENT '下注类型内容保存形式为“,号码1,号码2,”)',  `o_ids` varchar(255) NOT NULL DEFAULT '0' COMMENT '有关联的赔率设置分类id(0为没有关联)',  PRIMARY KEY (`f_id`)) ENGINE=MyISAM DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='固定的下注类型表'
DROP TABLE IF EXISTS login_code
CREATE TABLE `login_code` (  `id` int(10) NOT NULL AUTO_INCREMENT,  `user_id` int(10) NOT NULL COMMENT '用户id',  `login_ip` varchar(30) DEFAULT NULL COMMENT '登录ip',  `login_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '登录时间',  `login_location` varchar(70) DEFAULT NULL COMMENT '登录地址',  PRIMARY KEY (`id`),  KEY `user_id` (`user_id`)) ENGINE=MyISAM DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='用户登录记录表'
DROP TABLE IF EXISTS member_settlereport
CREATE TABLE `member_settlereport` (  `user_id` int(11) NOT NULL COMMENT '用户id',  `plate_num` varchar(10) NOT NULL COMMENT '格式“年+期数”，如：2012106',  `bishu` int(11) NOT NULL DEFAULT '0' COMMENT '註單筆數',  `order_y` int(11) NOT NULL DEFAULT '0' COMMENT '下註金額',  `shuying_y` float NOT NULL DEFAULT '0' COMMENT '輸贏結果',  `tuishui_y` float NOT NULL DEFAULT '0' COMMENT '退水',  `end_y` float NOT NULL DEFAULT '0' COMMENT '退水後結果',  PRIMARY KEY (`user_id`,`plate_num`),  KEY `plate_num` (`plate_num`)) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='会员结算报表'
DROP TABLE IF EXISTS odds_set
CREATE TABLE `odds_set` (  `user_id` int(11) NOT NULL DEFAULT '0' COMMENT '0为默认的，用户id，会员,股东，总代理，代理是没有赔率设置的，只有公司，分公司有',  `plate_num` varchar(10) NOT NULL DEFAULT '0' COMMENT '格式“年+期数”，如：2012106',  `o_id` int(11) NOT NULL COMMENT '赔率类型id',  `o_content` text COMMENT '赔率设置内容(保存形式为“,号码:赔率#是否封号(0为不封号)!当前期数下注总额,”)',  `ab_content` text COMMENT '同盘AB赔率设置内容(保存形式为“,码赔率,双面赔率,波色赔率,”)',  PRIMARY KEY (`user_id`,`plate_num`,`o_id`),  KEY `plate_num` (`plate_num`),  KEY `o_id` (`o_id`),  KEY `user_id` (`user_id`)) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='赔率设置表'
DROP TABLE IF EXISTS oddsset_type
CREATE TABLE `oddsset_type` (  `o_id` int(11) NOT NULL AUTO_INCREMENT,  `user_id` int(11) NOT NULL DEFAULT '0' COMMENT '用户id',  `o_topid` varchar(255) NOT NULL DEFAULT '0' COMMENT '上级类型id(0为顶级类)',  `o_typename` varchar(20) NOT NULL COMMENT '类型名',  `o_list_order` decimal(11,1) DEFAULT NULL COMMENT '最小下注',  `o_ccupy_money` decimal(11,0) DEFAULT NULL COMMENT '默认拦货金额',  `o_odd_limit` varchar(255) DEFAULT NULL COMMENT '赔率上限',  `o_dzlimit` int(11) DEFAULT NULL COMMENT '单注上限',  `o_dxlimit` int(11) DEFAULT NULL COMMENT '单项上限',  `o_content` text NOT NULL COMMENT '对应赔率，码数:赔率:1为禁用0为开启',  `o_tuishui` decimal(4,3) NOT NULL COMMENT '退水值',  PRIMARY KEY (`o_id`),  KEY `o_id` (`o_id`),  KEY `o_typename` (`o_typename`)) ENGINE=MyISAM AUTO_INCREMENT=1545 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='赔率设置类型表'
DROP TABLE IF EXISTS orders
CREATE TABLE `orders` (  `id` int(11) NOT NULL AUTO_INCREMENT,  `user_id` int(11) NOT NULL COMMENT '用户id',  `order_no` varchar(255) NOT NULL COMMENT '注单编号',  `plate_num` varchar(10) NOT NULL COMMENT '格式“年+期数”，如：2012106',  `time` int(11) NOT NULL COMMENT '下注时间',  `o_type1` varchar(10) DEFAULT NULL COMMENT '选择下注的类型1（如特码，正码）',  `o_type2` varchar(10) DEFAULT NULL COMMENT '选择下注的类型2 （如特码A，特码B）',  `o_type3` varchar(255) DEFAULT NULL COMMENT '要下注金额的类型3（号码，双面，波色，生肖等...）',  `orders_y` float NOT NULL DEFAULT '0' COMMENT '下注金额',  `orders_p` float NOT NULL DEFAULT '0' COMMENT '下注时的赔率值',  `orders_p_2` varchar(30) DEFAULT NULL COMMENT '下载时分公司和公司的赔率',  `is_maxorders_p` int(2) NOT NULL DEFAULT '0' COMMENT '中奖是否为大赔率，只有二中特，三中二有',  `abcd_h` varchar(10) NOT NULL DEFAULT 'A' COMMENT '下注对应的会员盘（分A,B,C,D盘）',  `h_tui` decimal(4,3) NOT NULL DEFAULT '0.000' COMMENT '会员退水值',  `d_tui` float NOT NULL DEFAULT '0' COMMENT '代理退水值',  `zd_tui` float NOT NULL DEFAULT '0' COMMENT '总代理退水值',  `gd_tui` float NOT NULL DEFAULT '0' COMMENT '股东退水值',  `f_tui` float NOT NULL DEFAULT '0' COMMENT '分公司退水值',  `g_tui` float NOT NULL DEFAULT '0' COMMENT '公司退水值',  `d_z` float NOT NULL DEFAULT '0' COMMENT '代理占成值',  `zd_z` float NOT NULL DEFAULT '0' COMMENT '总代理占成值',  `gd_z` float NOT NULL DEFAULT '0' COMMENT '股东占成值',  `f_z` float NOT NULL DEFAULT '0' COMMENT '分公司占成值',  `g_z` float NOT NULL DEFAULT '0' COMMENT '公司占成值',  `topd_id` int(11) NOT NULL DEFAULT '0' COMMENT '上级代理id',  `topzd_id` int(11) NOT NULL DEFAULT '0' COMMENT '上级总代理id',  `topgd_id` int(11) NOT NULL DEFAULT '0' COMMENT '上级股东id',  `topf_id` int(11) NOT NULL DEFAULT '0' COMMENT '上级分公司id',  `keying_y` float NOT NULL DEFAULT '0' COMMENT '可赢金额（下注金额*赔率-下注金额+该注退水金额）',  `shuying_y` float NOT NULL DEFAULT '0' COMMENT '输赢金额（中奖金额-下注金额，输赢金额不是最终的金额，输赢金额+退水金额才是最终金额，中奖金额为下注金额*下注类型的赔率）',  `tuishui_y` float NOT NULL DEFAULT '0' COMMENT '该注单退水金额（下注类型金额*下注类型的退水率--------退水也叫佣金）',  `is_win` int(2) NOT NULL DEFAULT '0' COMMENT '是否中奖,0为不中奖，1为中奖',  `fly_user` int(2) NOT NULL DEFAULT '0' COMMENT '下级走飞归属（分0“全归公司”，1“全归分公司”和2“按各级成数分配”）',  `fly_user_id` varchar(100) NOT NULL DEFAULT ',1,' COMMENT '该走飞单归属id',  `is_fly` int(2) NOT NULL DEFAULT '0' COMMENT '是否走飞单，0为否，1为是',  `is_zhishu` int(2) DEFAULT '0' COMMENT '是否直属会员单,0为否，1为是',  `history_is_account` int(2) NOT NULL DEFAULT '0' COMMENT '是否结算0未结算，1已结算',  `stattuima` int(2) NOT NULL DEFAULT '0' COMMENT '是否退码0为否1为是',  `tuima_time` varchar(255) NOT NULL COMMENT '退码时间',  `is_cloce` int(2) NOT NULL DEFAULT '0' COMMENT '是否清除0为否1为是',  `is_water` int(2) NOT NULL DEFAULT '0' COMMENT '是否为退水码，1为是，0为否',  PRIMARY KEY (`id`),  KEY `plate_num` (`plate_num`),  KEY `user_id` (`user_id`),  KEY `o_type2` (`o_type2`),  KEY `o_type3` (`o_type3`),  KEY `o_type1` (`o_type1`)) ENGINE=MyISAM AUTO_INCREMENT=5308 DEFAULT CHARSET=utf8 COMMENT='下注表'
DROP TABLE IF EXISTS orders_totalmoney
CREATE TABLE `orders_totalmoney` (  `id` int(11) NOT NULL AUTO_INCREMENT,  `user_id` int(11) NOT NULL COMMENT '用户id',  `plate_num` varchar(10) NOT NULL COMMENT '格式“年+期数”，如：2012106',  `orders_tm` float NOT NULL DEFAULT '0' COMMENT '下注总金额',  PRIMARY KEY (`id`),  KEY `plate_num` (`plate_num`)) ENGINE=MyISAM AUTO_INCREMENT=17 DEFAULT CHARSET=utf8 COMMENT='用户下注总金额记录表'
DROP TABLE IF EXISTS orders_type
CREATE TABLE `orders_type` (  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',  `start_odds` varchar(255) NOT NULL COMMENT '开始赔率',  `end_odds` varchar(255) NOT NULL COMMENT '结束赔率',  `plate_num` int(20) NOT NULL COMMENT '期数',  `o_typename` varchar(255) NOT NULL COMMENT '赔率类型',  PRIMARY KEY (`id`),  UNIQUE KEY `id` (`id`)) ENGINE=MyISAM AUTO_INCREMENT=178 DEFAULT CHARSET=utf8
DROP TABLE IF EXISTS plate
CREATE TABLE `plate` (  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT 'id',  `num_a` varchar(1) NOT NULL DEFAULT '0' COMMENT '开奖号码1',  `num_b` varchar(1) NOT NULL DEFAULT '0' COMMENT '开奖号码2',  `num_c` varchar(1) NOT NULL DEFAULT '0' COMMENT '开奖号码3',  `num_d` varchar(1) NOT NULL DEFAULT '0' COMMENT '开奖号码4',  `num_e` varchar(1) NOT NULL DEFAULT '0' COMMENT '开奖号码5',  `num_f` varchar(1) NOT NULL DEFAULT '0' COMMENT '开奖号码6',  `num_g` varchar(1) NOT NULL DEFAULT '0' COMMENT '开奖号码7',  `plate_num` varchar(10) NOT NULL COMMENT '格式“年+期数”，如：2012106',  `plate_time_satrt` varchar(30) NOT NULL COMMENT '开盘时间',  `plate_time_end` varchar(30) NOT NULL COMMENT '总封盘时间',  `plate_time_lottery` varchar(30) NOT NULL COMMENT '开奖时间',  `special_time_end` varchar(30) NOT NULL COMMENT '特码封盘时间',  `normal_time_end` varchar(30) NOT NULL COMMENT '正码封盘时间',  `is_plate_start` int(2) NOT NULL DEFAULT '1' COMMENT '状态0正在开盘，1正在封盘',  `is_auto` int(2) NOT NULL DEFAULT '0' COMMENT '自动开盘0允许，1禁止',  `is_special` int(2) NOT NULL DEFAULT '1' COMMENT '特码1开，0封',  `is_normal` int(2) NOT NULL DEFAULT '1' COMMENT '正码1开，0封',  `last_special` int(2) NOT NULL DEFAULT '1' COMMENT '分“1,2,3,4,5,6”，开完第几个正码后全部封盘',  `adrop` varchar(10) NOT NULL DEFAULT '0' COMMENT '根据赔率设置里确定这个赔率，每输入一个下码赔率降几赔',  `history_is_account` int(2) NOT NULL DEFAULT '0' COMMENT '是否结算0未结算，1已结算',  `history_is_lock` int(2) NOT NULL DEFAULT '0' COMMENT '是否开启，0以关闭，1已开启',  `animal_set_id` int(3) NOT NULL COMMENT '对应animal表set_id',  `open_num` int(2) DEFAULT '0' COMMENT '开到第几个号码',  `true_time_lottery` varchar(30) NOT NULL COMMENT '真实开奖时间或最后更新时间',  PRIMARY KEY (`id`),  UNIQUE KEY `plate_num` (`plate_num`),  KEY `plate_time_end` (`plate_time_end`),  KEY `animal_set_id` (`animal_set_id`)) ENGINE=MyISAM AUTO_INCREMENT=248 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='开奖表'
DROP TABLE IF EXISTS plate_autoadd
CREATE TABLE `plate_autoadd` (  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT 'id',  `num_a` varchar(2) NOT NULL DEFAULT '0' COMMENT '开奖号码1',  `num_b` varchar(2) NOT NULL DEFAULT '0' COMMENT '开奖号码2',  `num_c` varchar(2) NOT NULL DEFAULT '0' COMMENT '开奖号码3',  `num_d` varchar(2) NOT NULL DEFAULT '0' COMMENT '开奖号码4',  `num_e` varchar(2) NOT NULL DEFAULT '0' COMMENT '开奖号码5',  `num_f` varchar(2) NOT NULL DEFAULT '0' COMMENT '开奖号码6',  `num_g` varchar(2) NOT NULL DEFAULT '0' COMMENT '开奖号码7',  `plate_num` varchar(10) NOT NULL COMMENT '格式“年+期数”，如：2012106',  `plate_time_satrt` varchar(30) NOT NULL COMMENT '开盘时间',  `plate_time_end` varchar(30) NOT NULL COMMENT '总封盘时间',  `plate_time_lottery` varchar(30) NOT NULL COMMENT '开奖时间',  `special_time_end` varchar(30) NOT NULL COMMENT '特码封盘时间',  `normal_time_end` varchar(30) NOT NULL COMMENT '正码封盘时间',  `is_plate_start` int(2) NOT NULL DEFAULT '1' COMMENT '状态0正在开盘，1正在封盘',  `is_auto` int(2) NOT NULL DEFAULT '0' COMMENT '自动开盘0允许，1禁止',  `is_special` int(2) NOT NULL DEFAULT '1' COMMENT '特码1开，0封',  `is_normal` int(2) NOT NULL DEFAULT '1' COMMENT '正码1开，0封',  `last_special` int(2) NOT NULL DEFAULT '1' COMMENT '分“1,2,3,4,5,6”，开完第几个正码后全部封盘',  `adrop` varchar(10) NOT NULL DEFAULT '0' COMMENT '根据赔率设置里确定这个赔率，每输入一个下码赔率降几赔',  `history_is_account` int(2) NOT NULL DEFAULT '0' COMMENT '是否结算0未结算，1已结算',  `history_is_lock` int(2) NOT NULL DEFAULT '0' COMMENT '是否开启，0以关闭，1已开启',  `animal_set_id` int(3) NOT NULL COMMENT '对应animal表set_id',  `open_num` int(2) DEFAULT '0' COMMENT '开到第几个号码',  `true_time_lottery` varchar(30) NOT NULL COMMENT '真实开奖时间或最后更新时间',  PRIMARY KEY (`id`),  UNIQUE KEY `plate_num` (`plate_num`),  KEY `plate_time_end` (`plate_time_end`),  KEY `animal_set_id` (`animal_set_id`)) ENGINE=MyISAM AUTO_INCREMENT=312 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='盘口添加表'
DROP TABLE IF EXISTS rain_set
CREATE TABLE `rain_set` (  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',  `number` varchar(255) NOT NULL COMMENT '下注号码',  `auto_num` float(4,3) NOT NULL DEFAULT '0.000' COMMENT '自动降水值',  `manual_num` float(4,3) NOT NULL DEFAULT '0.000' COMMENT '手动降水值',  `auto_time` varchar(255) NOT NULL COMMENT '自动下降开始时间',  PRIMARY KEY (`id`)) ENGINE=MyISAM AUTO_INCREMENT=8 DEFAULT CHARSET=utf8 COMMENT='降水记录表'
DROP TABLE IF EXISTS reports
CREATE TABLE `reports` (  `id` int(11) NOT NULL AUTO_INCREMENT,  `top_id` int(11) NOT NULL COMMENT '上级用户id',  `user_id` int(11) NOT NULL COMMENT '用户id',  `user_name` varchar(10) NOT NULL COMMENT '用户名',  `user_nickname` varchar(10) DEFAULT NULL COMMENT '用户名称',  `plate_num` varchar(10) NOT NULL COMMENT '格式“年+期数”，如：2012106',  `orders_sum` int(11) NOT NULL COMMENT '下注笔数 （下注总笔数）',  `orders_total` float NOT NULL DEFAULT '0' COMMENT '下注总额 （下注总金额）',  `orders_truetotal` float NOT NULL DEFAULT '0' COMMENT '实投总额 （下注总额-该会员的退水总额）',  `user_wl` float NOT NULL DEFAULT '0' COMMENT '会员输赢 （该会员的中奖金额-下注总金额+该会员的退水金额）',  `receivable_down` float NOT NULL DEFAULT '0' COMMENT '应收下线',  `occupy` float NOT NULL DEFAULT '0' COMMENT '占成%    （该会员的占成）',  `true_downmoney` float NOT NULL DEFAULT '0' COMMENT '实占注额 （下注总额*占成%/100）',  `true_back` float NOT NULL DEFAULT '0' COMMENT '实占退水 （该会员的退水金额*占成%/100，为负数）',  `true_occupyresult` float NOT NULL DEFAULT '0' COMMENT '实占结果 （每注单的会员输赢*占成%/100，最终的总和的相反数）',  `earn_back` float NOT NULL DEFAULT '0' COMMENT '赚取退水 （添加账号时的赚钱退水值）',  `true_result` float NOT NULL DEFAULT '0' COMMENT '实际结果 （实占结果+赚取退水）',  `contribution_top` float NOT NULL DEFAULT '0' COMMENT '贡献上级',  `meet_top` float NOT NULL DEFAULT '0' COMMENT '应付上级',  `time` int(11) NOT NULL DEFAULT '0' COMMENT '结算时间',  PRIMARY KEY (`id`)) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='结算报表'
DROP TABLE IF EXISTS single_set
CREATE TABLE `single_set` (  `user_id` int(11) NOT NULL COMMENT '用户id',  `o_id` int(11) NOT NULL COMMENT '下注类型id(顶级id，如：特码，正一特)',  `kx_value` float NOT NULL DEFAULT '0' COMMENT '亏损值',  `zc_value` float NOT NULL DEFAULT '0' COMMENT '占成值',  `zfts_value` float NOT NULL DEFAULT '0' COMMENT '走飞默认退水值（只有管理员(公司)权限才有这个值，因为它们没有退水设置）',  `j_value` float NOT NULL DEFAULT '0' COMMENT '警值',  PRIMARY KEY (`user_id`,`o_id`)) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='即时注单设置表'
DROP TABLE IF EXISTS system_marquee
CREATE TABLE `system_marquee` (  `id` int(11) NOT NULL AUTO_INCREMENT,  `user` varchar(25) NOT NULL COMMENT '能看见公告的用户类型',  `type` smallint(2) NOT NULL DEFAULT '0' COMMENT '0为普通跑马灯，1为弹出跑马灯',  `content` text NOT NULL COMMENT '公告内容',  `datetime` int(11) NOT NULL COMMENT '发布时间',  PRIMARY KEY (`id`),  KEY `user` (`user`)) ENGINE=MyISAM AUTO_INCREMENT=15 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='跑马灯表'
DROP TABLE IF EXISTS tuishui_set
CREATE TABLE `tuishui_set` (  `t_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',  `user_id` int(11) NOT NULL COMMENT '用户id',  `tuishui` decimal(4,3) NOT NULL COMMENT '退水值',  `d_tui` decimal(4,3) NOT NULL COMMENT '代理退水',  `zd_tui` decimal(4,3) NOT NULL COMMENT '总代理退水',  `gd_tui` decimal(4,3) NOT NULL COMMENT '股东退水',  `fg_tui` decimal(4,3) NOT NULL COMMENT '分公司退水',  `d_lh` int(255) NOT NULL COMMENT '代理拦货',  `oddsset` varchar(255) NOT NULL COMMENT '赔率',  `o_odds_limit` varchar(255) NOT NULL COMMENT '赔率上限',  `odds_id` int(11) NOT NULL COMMENT '赔率表id',  `typename` varchar(11) NOT NULL COMMENT '下注类型',  PRIMARY KEY (`t_id`)) ENGINE=MyISAM AUTO_INCREMENT=1498 DEFAULT CHARSET=utf8
DROP TABLE IF EXISTS update_code
CREATE TABLE `update_code` (  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT 'id',  `user_id` int(10) NOT NULL COMMENT '用户id',  `up_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '更新时间',  `up_type` varchar(40) NOT NULL COMMENT '更新项目',  `or_value` varchar(30) NOT NULL COMMENT '原值',  `now_value` varchar(30) NOT NULL COMMENT '现在值',  `up_user_name` varchar(30) NOT NULL COMMENT '操作人',  `up_user_ip` varchar(30) DEFAULT NULL COMMENT '操作人ip',  `up_user_location` varchar(50) DEFAULT NULL COMMENT '操作人ip归属',  PRIMARY KEY (`id`),  KEY `user_id` (`user_id`)) ENGINE=MyISAM AUTO_INCREMENT=128 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='数据变更记录表'
DROP TABLE IF EXISTS users
CREATE TABLE `users` (  `user_id` int(10) NOT NULL AUTO_INCREMENT COMMENT '用户id',  `user_name` varchar(30) NOT NULL COMMENT '用户账号',  `user_nick` varchar(30) NOT NULL COMMENT '用户昵称',  `user_pwd` varchar(70) NOT NULL COMMENT '用户密码',  `user_power` int(3) NOT NULL COMMENT '用户身份（权限）1管理员，2分公司，3股东，4总代理，5代理，6会员',  `top_id` int(10) NOT NULL DEFAULT '0' COMMENT '上级id',  `top_name` varchar(30) DEFAULT NULL COMMENT '上级账户',  `top_power` int(3) NOT NULL DEFAULT '0' COMMENT '上级身份',  `credit_total` bigint(20) NOT NULL DEFAULT '500000' COMMENT '信用总额',  `credit_remainder` bigint(20) NOT NULL DEFAULT '500000' COMMENT '信用余额',  `percent_company` int(4) NOT NULL DEFAULT '0' COMMENT '公司占成',  `percent_branch` int(4) NOT NULL DEFAULT '0' COMMENT '分公司占成',  `percent_partner` int(4) NOT NULL DEFAULT '0' COMMENT '股东占成',  `percent_all_proxy` int(4) NOT NULL DEFAULT '0' COMMENT '总代理占成',  `percent_proxy` int(4) NOT NULL DEFAULT '0' COMMENT '代理占成',  `is_lock` int(2) NOT NULL DEFAULT '0' COMMENT '0正常，1冻结,2停用',  `is_bet` int(2) NOT NULL DEFAULT '0' COMMENT '0正常，1禁止下注（停押）',  `is_odds` int(2) NOT NULL DEFAULT '0' COMMENT '0允许开放赔率，1禁止开放赔率',  `is_add` int(2) NOT NULL DEFAULT '0' COMMENT '0允许补货，1禁止补货',  `is_remainder_percent` int(2) NOT NULL DEFAULT '0' COMMENT '0剩余成数“全归公司”，1剩余成数“全归分公司”',  `is_fly` int(2) NOT NULL DEFAULT '0' COMMENT '下级走飞归属（分0“全归公司”，1“全归分公司”和2“按各级成数分配”）',  `is_extend` int(10) NOT NULL DEFAULT '0' COMMENT '0非子账户，否则所属账户的id（主账户id）',  `is_directly` int(2) NOT NULL DEFAULT '0' COMMENT '0非直属会员，1直属会员',  `else_plate` varchar(20) NOT NULL DEFAULT 'A,B,C,D' COMMENT '盘口，A,B,C,D',  `else_created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '注册时间',  `else_count_login` int(10) NOT NULL DEFAULT '0' COMMENT '登陆次数',  `else_last_login` int(11) NOT NULL DEFAULT '0' COMMENT '最新登陆时间戳',  `else_back` float NOT NULL DEFAULT '0' COMMENT '退水',  `is_online` int(2) NOT NULL DEFAULT '0' COMMENT '是否在线，1为在线，反之',  `is_ti` int(2) NOT NULL DEFAULT '0' COMMENT '是否被踢出 1为被踢出，反之',  `is_edit_bill` int(2) NOT NULL DEFAULT '0' COMMENT '是否可以修改账单 0为允许，1为禁止，反之',  `close_type` varchar(100) DEFAULT NULL COMMENT '关闭项目',  `user_total` int(10) NOT NULL DEFAULT '0' COMMENT '可开会员个数',  `is_del` int(2) NOT NULL DEFAULT '0' COMMENT '是否被删除，1为是，0为否',  `bet_times` int(11) NOT NULL DEFAULT '0' COMMENT '当前期下注次数',  `opera_water` int(11) NOT NULL DEFAULT '0' COMMENT '操作退水金额',  `stop_water` int(2) NOT NULL DEFAULT '0' COMMENT '是否暂停退水码，1为是，0为否',  PRIMARY KEY (`user_id`),  UNIQUE KEY `user_name` (`user_name`),  KEY `user_power` (`user_power`) USING BTREE,  KEY `user_id` (`user_id`)) ENGINE=MyISAM AUTO_INCREMENT=127 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='用户表'
